import React, { useState, useEffect } from 'react';
import { analyticsAPI } from '../../services/api';

const AnalyticsDashboard = () => {
  const [analytics, setAnalytics] = useState(null);
  const [loading, setLoading] = useState(true);
  const [timeRange, setTimeRange] = useState('monthly');

  useEffect(() => {
    fetchAnalytics();
  }, [timeRange]);

  const fetchAnalytics = async () => {
    try {
      const response = await analyticsAPI.getPlatform(timeRange);
      setAnalytics(response.data);
    } catch (error) {
      console.error('Error fetching analytics:', error);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return <div className="loading">Loading analytics...</div>;
  }

  if (!analytics) {
    return <div className="error">Failed to load analytics</div>;
  }

  const { overview, categoryStats, monthlyGrowth, recentActivities } = analytics;

  return (
    <div className="analytics-dashboard">
      <div className="section-header">
        <h2>Platform Analytics</h2>
        <div className="time-range-selector">
          <select 
            value={timeRange} 
            onChange={(e) => setTimeRange(e.target.value)}
          >
            <option value="weekly">Weekly</option>
            <option value="monthly">Monthly</option>
            <option value="yearly">Yearly</option>
          </select>
        </div>
      </div>

      {/* Overview Stats */}
      <div className="analytics-overview">
        <div className="stats-grid">
          <div className="stat-card primary">
            <div className="stat-icon">üè´</div>
            <div className="stat-info">
              <h3>{overview.totalInstitutes}</h3>
              <p>Total Institutes</p>
            </div>
          </div>
          <div className="stat-card success">
            <div className="stat-icon">üë•</div>
            <div className="stat-info">
              <h3>{overview.totalUsers}</h3>
              <p>Total Users</p>
            </div>
          </div>
          <div className="stat-card warning">
            <div className="stat-icon">‚≠ê</div>
            <div className="stat-info">
              <h3>{overview.totalReviews}</h3>
              <p>Total Reviews</p>
            </div>
          </div>
          <div className="stat-card info">
            <div className="stat-icon">üí¨</div>
            <div className="stat-info">
              <h3>{overview.totalEnquiries}</h3>
              <p>Total Enquiries</p>
            </div>
          </div>
          <div className="stat-card danger">
            <div className="stat-icon">‚è≥</div>
            <div className="stat-info">
              <h3>{overview.pendingInstitutes}</h3>
              <p>Pending Approvals</p>
            </div>
          </div>
        </div>
      </div>

      <div className="analytics-content">
        <div className="analytics-row">
          {/* Category Distribution */}
          <div className="analytics-card">
            <h3>Institutes by Category</h3>
            <div className="category-distribution">
              {categoryStats.map(category => (
                <div key={category._id} className="category-item">
                  <div className="category-info">
                    <span className="category-name">{category._id}</span>
                    <span className="category-count">{category.count}</span>
                  </div>
                  <div className="category-bar">
                    <div 
                      className="category-fill"
                      style={{
                        width: `${(category.count / overview.totalInstitutes) * 100}%`
                      }}
                    ></div>
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Recent Activities */}
          <div className="analytics-card">
            <h3>Recent Activities</h3>
            <div className="recent-activities">
              <div className="activity-section">
                <h4>New Institutes</h4>
                {recentActivities.institutes.slice(0, 3).map(institute => (
                  <div key={institute._id} className="activity-item">
                    <div className="activity-icon">üè´</div>
                    <div className="activity-content">
                      <p><strong>{institute.name}</strong> registered</p>
                      <span className="activity-time">
                        {new Date(institute.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
              
              <div className="activity-section">
                <h4>Recent Reviews</h4>
                {recentActivities.reviews.slice(0, 3).map(review => (
                  <div key={review._id} className="activity-item">
                    <div className="activity-icon">‚≠ê</div>
                    <div className="activity-content">
                      <p><strong>{review.user.name}</strong> reviewed {review.institute.name}</p>
                      <span className="activity-time">
                        {new Date(review.createdAt).toLocaleDateString()}
                      </span>
                    </div>
                  </div>
                ))}
              </div>
            </div>
          </div>
        </div>

        {/* Growth Chart */}
        <div className="analytics-card full-width">
          <h3>Platform Growth</h3>
          <div className="growth-chart">
            {monthlyGrowth.map((month, index) => (
              <div key={index} className="chart-bar">
                <div className="bar-label">
                  {month._id.month}/{month._id.year}
                </div>
                <div className="bar-container">
                  <div 
                    className="bar-fill"
                    style={{ height: `${(month.count / Math.max(...monthlyGrowth.map(m => m.count))) * 100}%` }}
                  ></div>
                </div>
                <div className="bar-value">{month.count}</div>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default AnalyticsDashboard;
